import React, {Component} from 'react';
import { Scrollbars } from 'react-custom-scrollbars';

import CreateUser from './UsersForms/CreateUser'
import EditUser from './UsersForms/EditUser'
import DeleteUser from './UsersForms/DeleteUser'
import ViewUser from './UsersForms/ViewUser'
import FormControl from '../../../Main/UI/SingleComponent/FormControl'

export default class Admin extends Component {
  
    render() {

        const title = ['View User Account', 'Create User Account', 'Edit User Account', 'Delete User Account'];
        const com = [<ViewUser/>, <CreateUser/>, <EditUser/>, <DeleteUser/>];

        return (
            <FormControl
                titles = {title}
                startPos = {0}
                components = {com}
                viewBtn = {false}
                editBtn = {true}
                createBtn = {true}
                deleteBtn = {true}
            />
      );
    }
}
